import React from "react";
import ToolBar from "@mui/material/Toolbar";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";

import { makeStyles } from "@mui/styles";

// import Typography from "@mui/material/Typography";

// creative components
import logo from "../../assets/logo.svg";

// Styling
const useStyles = makeStyles(() => ({
  logo: {
    height: "5em",
  },
  tabsContainer: {
    marginLeft: "auto",
    color: "white",
  },
}));

// Styling the tab directly
const tabStyling = {
  color: "white",
  fontFamily: "Raleway",
  textTransform: "none",
  fontWeight: "700",
  fontSize: "1rem",
};

const ToolBarCom: React.FC = () => {
  const classes = useStyles();

  return (
    <ToolBar disableGutters>
      {/* <Typography variant='h3'>Arc Development</Typography> */}
      <img src={logo} alt='company logo' className={classes.logo} />
      <Tabs className={classes.tabsContainer}>
        <Tab
          label={
            <span
              style={{
                color: "white",
                fontFamily: "Raleway",
                textTransform: "none",
                fontWeight: "700",
                fontSize: "1rem",
                minWidth: 10,
                marginLeft: "25px",
              }}>
              Home
            </span>
          }
        />
        <Tab
          label={
            <span
              style={{
                color: "white",
                fontFamily: "Raleway",
                textTransform: "none",
                fontWeight: "700",
                fontSize: "1rem",
              }}>
              Services
            </span>
          }
        />
        <Tab
          label={
            <span
              style={{
                color: "white",
                fontFamily: "Raleway",
                textTransform: "none",
                fontWeight: "700",
                fontSize: "1rem",
              }}>
              The Revolution
            </span>
          }
        />
        <Tab
          label={
            <span
              style={{
                color: "white",
                fontFamily: "Raleway",
                textTransform: "none",
                fontWeight: "700",
                fontSize: "1rem",
              }}>
              About Us
            </span>
          }
        />
        <Tab
          label={
            <span
              style={{
                color: "white",
                fontFamily: "Raleway",
                textTransform: "none",
                fontWeight: "700",
                fontSize: "1rem",
              }}>
              Contact Us
            </span>
          }
        />
      </Tabs>
    </ToolBar>
  );
};

export default ToolBarCom;
